import "./style.css";
import { Link } from "react-router-dom";
import youtubeIcon from "../../assets/images/icoyoutube.png";
import instagramIcon from "../../assets/images/icoinstagram.png";
import facebookIcon from "../../assets/images/icofacebook.png";
import linkedinIcon from "../../assets/images/icolinkedin.png";
import twitterIcon from "../../assets/images/icotwitter.png";
import NavSection from "../NavSection";

const header = ({ windowScrollY, setContactShow }) => {
  return (
    <header>
      <section>
        <Link to="/">
          <h2>Ariadna Santana</h2>
        </Link>

        <NavSection />
      </section>

      <menu
        style={{
          position: windowScrollY,
        }}
      >
        <li>
          <Link
            to="/"
            onClick={() => {
              setContactShow(true);
            }}
          >
            INICIO
          </Link>
        </li>
        <li>
          <Link
            to="/series"
            onClick={() => {
              setContactShow(true);
            }}
          >
            SERIES
          </Link>
        </li>
        <li>
          <Link
            to="/cinetv"
            onClick={() => {
              setContactShow(true);
            }}
          >
            CINE/TV
          </Link>
        </li>
        <li>
          <Link
            to="/teatro"
            onClick={() => {
              setContactShow(true);
            }}
          >
            TEATRO
          </Link>
        </li>
        <li>
          <Link
            to="/teatro"
            onClick={() => {
              setContactShow(true);
            }}
          >
            MÃšSICA
          </Link>
        </li>
        <li>
          <Link
            to="/fotos"
            onClick={() => {
              setContactShow(true);
            }}
          >
            FOTOS
          </Link>
        </li>
        <li>
          <Link
            to="/cv"
            onClick={() => {
              setContactShow(true);
            }}
          >
            CV
          </Link>
        </li>
        <li>
          <Link
            to="/contacto"
            onClick={() => {
              setContactShow(false);
            }}
          >
            CONTACTO
          </Link>
        </li>
      </menu>
    </header>
  );
};
export default header;
